import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the "All" menu button to open the mobile menu modal
    const menuButton = page.locator('div.nav-menu:has-text("All")');
    await menuButton.waitFor({ state: 'visible', timeout: 5000 });
    await menuButton.click();

    // Wait for the mobile menu overlay to be visible and take a screenshot
    const mobileMenuOverlay = page.locator('#mobileMenuOverlay');
    await mobileMenuOverlay.waitFor({ state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    const isModalVisibleBefore = await mobileMenuOverlay.isVisible();

    // Press the Escape key to close the modal
    await page.keyboard.press('Escape');

    // Wait for the modal to be hidden and take a final screenshot
    await mobileMenuOverlay.waitFor({ state: 'hidden', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    // Extract data to verify the modal is closed
    const isModalVisibleAfter = await mobileMenuOverlay.isVisible();

    if (isModalVisibleAfter) {
      throw new Error('Modal did not close after pressing Escape key.');
    }

    return {
      success: true,
      action: "Successfully opened and closed the mobile menu modal using the Escape key.",
      extractedData: {
        modalVisibleBeforeEscape: isModalVisibleBefore,
        modalVisibleAfterEscape: isModalVisibleAfter
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
